def count_fractions(n):
    """"""
    (a, b, c, d) = (1, 2, 2, 3)
    counter = 0
    while True:
        k = (n + b) // d
        (a, b, c, d) = (c, d, k * c - a, k * d - b)
        if a / b < 1 / 2:
            continue
        if 2 / 3 < a / b:
            break
        counter += 1
    return counter
